// CodeforcesInfo.js

import React, { useState, useEffect } from 'react';
import './App.css';
import './Styles.css';


const CodeforcesInfo = () => {
  const [codeforcesData, setCodeforcesData] = useState(null);

  useEffect(() => {
    // Fetch Codeforces data and update the state
    // Replace the following with actual data fetching logic

    const fetchData = async () => {
      // Example URL
      const apiUrl = 'https://codeforces.com/api/user.info?handles=your_codeforces_handle';

      try {
        const response = await fetch(apiUrl);
        const data = await response.json();
        setCodeforcesData(data.result[0]);
      } catch (error) {
        console.error('Error fetching Codeforces data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="card">
      <h2>Codeforces Information</h2>
      {codeforcesData && (
        <div className="card-content">
          <p>Contribution Count: {codeforcesData.contribution}</p>
          <p>Problem Solved: {codeforcesData.problem_solved}</p>
          <p>Rank: {codeforcesData.rank}</p>
        </div>
      )}
    </div>
  );
};

export default CodeforcesInfo;
